"use client";

import { useState } from "react";
import AdminDashboard from "../PortfolioPage/Portfolio_1/admindashboard";

const SvgComponent = () => {
  const [activeComponent, setActiveComponent] = useState(null);

  const handleActiveComponent = (componentId) => {
    setActiveComponent(componentId);
  };

  const handleCloseModal = () => {
    setActiveComponent(null);
  };

  return (
    <div>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        viewBox="0 0 1350 410"
        preserveAspectRatio="xMidYMid meet"
        fill="none"
      >
        <path
          stroke="#FFFDFD"
          strokeDasharray="10 20"
          strokeWidth={2}
          d="m1191.27 360.994-20.72-39.416-43.95-83.07-210.162 18.247-95.123-54.732-107.058-53.784-207.105-39.274-260.221 18.364L37.816 81.645"
        />
        <path fill="url(#a)" d="M0 32h100v100H0z" />
        <path fill="url(#b)" d="M223 72h100v100H223z" />
        <path
          fill="url(#c)"
          d="M461 45h100v100H461z"
          onClick={() => {
            handleActiveComponent("component1");
          }}
        />
        <path fill="url(#d)" d="M869 217h100v100H869z" />
        <path fill="url(#e)" d="M1058 172h100v100h-100z" />
        <path fill="url(#f)" d="M1123 317h100v100h-100z" />
        <path fill="url(#g)" d="M660 90h100v100H660z" />
        <defs>
          <pattern
            id="a"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#h" transform="scale(.01)" />
          </pattern>
          <pattern
            id="b"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#i" transform="scale(.01)" />
          </pattern>
          <pattern
            id="c"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#j" transform="scale(.01)" />
          </pattern>
          <pattern
            id="d"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#k" transform="scale(.01)" />
          </pattern>
          <pattern
            id="e"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#l" transform="scale(.01)" />
          </pattern>
          <pattern
            id="f"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#m" transform="scale(.01)" />
          </pattern>
          <pattern
            id="g"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#n" transform="scale(.01)" />
          </pattern>
          <image
            xlinkHref="data:image/png;base64,"
            id="h"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="i"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="j"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="k"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="l"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="m"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="n"
            width={100}
            height={100}
          />
        </defs>
      </svg>
      <AdminDashboard
        isOpen={activeComponent === "component1"}
        onOpenChange={() => handleCloseModal()}
      />
    </div>
  );
};
export default SvgComponent;
